import { increment,decrement, incrementByAmount } from "./Slice/counterSlice"

import { useSelector,useDispatch } from "react-redux"

function Login(){

    const count = useSelector((state)=>state.count.value)

    return(
        <>
           <h2>Welcome,{count}</h2>
        </>
    )
}

export default Login
